console.log("Main Home Page All Level Listed Here Working")

// Loader When Page is Load
window.onload = function () { document.getElementById("loading").style.display = "none" }

// Access Canvas From index.html File
// const canvas = document.querySelector('.c');
const canvas = document.querySelector('.AllLevel');
// document.addEventListener('touchstart', handler, {passive: true});

// Scene  - Global
var scene = new THREE.Scene();


// Camera - Global
var camera = new THREE.PerspectiveCamera(
    60,
    window.innerWidth / window.innerHeight,
    1,
    1000
);
camera.position.set(0, 0, 4);


// Renderer - Global
const renderer = new THREE.WebGLRenderer({
    canvas,
    // canvasPopup,
    alpha: true,
    antialias: true,
});
renderer.setPixelRatio(window.devicePixelRatio);
renderer.setSize(window.innerWidth, window.innerHeight);
// console.log("window.innerWidth, window.innerHeight",window.innerWidth, window.innerHeight);
document.body.appendChild(renderer.domElement);

// Render Scene and Camera  - Global
renderer.render(scene, camera)
document.body.appendChild(renderer.domElement);

// Resize the Screen  - Global
window.addEventListener('resize', function () {
    camera.aspect = window.innerWidth / window.innerHeight;
    camera.updateProjectionMatrix();
    renderer.setSize(window.innerWidth, window.innerHeight)
})

// Global Varibles
// var planeLHSMain, planeRHSMain
var planeL1, planeL2, planeL3, planeL4


// Global x,y Size For Slide Rounds
// SXIPosL1 = Slide X Image Position   L1
// SYIPosL1 = Slide Y Image Position   L1
